import React, { useEffect, useState } from "react";
import { apiUrl, axiosInstance, generateRefreshToken } from "../axios";

export default function MedicineBookings() {
  const [medicineBookings, setMedicineBookings] = useState({});

  useEffect(() => {
    getMedicineBookings();
  }, []);

  const updateMedicineBookingStatus = async (bookingId, statusType) => {
    await axiosInstance
      .put(apiUrl + "/medical_store_app/medicine/book/" + bookingId + "/" + statusType)
      .then((response) => {
        if (response.status === 200) {
          alert(response.data);
          window.location.reload(false);
        }
      })
      .catch((error) => {
        if (error.response.status === 401) {
          generateRefreshToken(error);
        }
      });
  };
  

  const getMedicineBookings = async () => {
    await axiosInstance
      .get(
        apiUrl + "/medical_store_app/medicine/booking/" +
        sessionStorage.getItem("user_id")
      )
      .then((response) => {
        if (response.status === 200) {
          setMedicineBookings(response.data);
        }
      })
      .catch((error) => {
        console.log(error);
        if (error.response.status === 401) {
          generateRefreshToken(error);
        }
      });
  };

  // Inline CSS Styles
  const containerStyle = {
    margin: "50px",
  };

  const tableStyle = {
    width: "100%",
    borderCollapse: "collapse",
  };

  const thStyle = {
    backgroundColor: "#343a40",
    color: "white",
    padding: "10px",
  };

  const tdStyle = {
    padding: "10px",
    border: "1px solid #ddd",
  };

  const buttonStyle = {
    marginRight: "10px",
  };

  return (
    <div>
      <div style={containerStyle}>
        <div style={{ marginTop: "30px" }}>
          <table style={tableStyle}>
            <thead>
              <h2>View Bookings</h2>
              <tr>
                <th style={thStyle}>SLNo</th>
                <th style={thStyle}>Medicine</th>
                <th style={thStyle}>Booking Status</th>
                <th style={thStyle}>Booked By</th>
                <th style={thStyle}>From Time</th>
                <th style={thStyle}>To Time</th>
                <th style={thStyle}>Created At</th>
                <th style={thStyle}>Action</th>
              </tr>
            </thead>
            <tbody>
              {Object.keys(medicineBookings).map((key, i) => {
                return (
                  <tr key={`medicine_rows${i}`}>
                    <td style={tdStyle}>{i + 1}</td>
                    <td style={tdStyle}>{medicineBookings[key]["medicine_name"]}</td>
                    <td style={tdStyle}>{medicineBookings[key]["booking_status"]}</td>
                    <td style={tdStyle}>{medicineBookings[key]["booking_by_name"]}</td>
                    <td style={tdStyle}>
                      {new Date(medicineBookings[key]["from_time"]).toLocaleString()}
                    </td>
                    <td style={tdStyle}>
                      {new Date(medicineBookings[key]["to_time"]).toLocaleString()}
                    </td>
                    <td style={tdStyle}>
                      {new Date(medicineBookings[key]["created_at"]).toLocaleString()}
                    </td>

                    <td style={tdStyle}>
                      {medicineBookings[key]["booking_status"] === "Pending" ? (
                        <>
                          <a
                            href="#"
                            onClick={() =>
                              updateMedicineBookingStatus(
                                medicineBookings[key]["id"],
                                "confirm"
                              )
                            }
                            className="btn btn-success"
                            style={buttonStyle}
                          >
                            Approve
                          </a>
                          <a
                            href="#"
                            onClick={() =>
                              updateMedicineBookingStatus(
                                medicineBookings[key]["id"],
                                "reject"
                              )
                            }
                            className="btn btn-danger"
                            style={buttonStyle}
                          >
                            Reject
                          </a>
                        </>
                      ) : medicineBookings[key]["booking_status"] === "Confirmed" ? (
                        <>
                          <a
                            href="#"
                            onClick={() =>
                              updateMedicineBookingStatus(
                                medicineBookings[key]["id"],
                                "complete"
                              )
                            }
                            className="btn btn-secondary"
                            style={buttonStyle}
                          >
                            Complete
                          </a>
                        </>
                      ) : (
                        medicineBookings[key]["booking_status"]
                      )}
                    </td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
